import React from 'react'

class TaskPage extends React.Component {

    stat = {
        task: null
    }

    componentDidMount() {
        fetch(`http://localhost:3000/listings/${this.props.match.params.id}`)
      .then(r => r.json())
      .then(listing => {
        this.setState({
          listing: listing,
          loaded: true
        })
      })
    }

    render() {

        return(
            <h1>This is my Task Page!</h1>
        )
    }
}

export default TaskPage;
